First, install package for DHCP server: sudo apt-get install isc-dhcp-server Then run ifconfig to view available networking devices and find the network device name, e.g., eth0. Edit the /etc/default/isc-dhcp-server configuration file and add the network device name from the step above to "INTERFACES". For me, this looks like INTERFACES="eth0". Configure an arbitrary IP address that will be used in the next step: sudo ifconfig <network-device-name> 192.168.1.105 This command might have to be done each time the computer being used as a server is restarted. Edit the /etc/dhcp/dhcpd.conf file by uncommenting the line authoritative; and adding a subnet configuration such as the one below: subnet 192.168.1.0 netmask 255.255.255.0 { range 192.168.1.20 192.168.1.30; option routers 192.168.1.1; option broadcast-address 192.168.1.255; default-lease-time 600; max-lease-time 7200;
} allow booting;
allow bootp;
option option-128 code 128 = string;
option option-129 code 129 = text;
next-server 192.168.1.105;
filename "pxelinux.0"; Restart the DHCP server and check to see if it's running: sudo systemctl restart isc-dhcp-server sudo systemctl status isc-dhcp-server
